import React from 'react';
import './App.css'

const Card = (props) =>{
    return (
        <div className="card">
            <div>
                <img src={props.img} alt={props.title}/>
            </div>
            <div>
                <span>{props.type}</span>
                <h3>{props.title}</h3>
            </div>



        </div>
    )

}




export default Card;
